NewsFeed\httpsfeedqgisorg\16\content="<p>Am Donnerstag 14. November findet der PostGIS Day in Z&uuml;rich statt! Neben topaktuellen News zu den Releases von PostGIS 3, QGIS 3.10 LTR und OpenLayers 6 gibt es Einblicke in die Responsive City Strategie der Stadt Z&uuml;rich und weitere Themen wie Datentransformationen mit hale studio und Vektor Tiles.<br /><br />Fotocredit: Von Ikiwaner - Selbst fotografiert, CC BY-SA 3.0, https://commons.wikimedia.org/w/index.php?curid=1363948</p>"
