NewsFeed\httpsfeedqgisorg\20\title="Invitation pour la journ\xe9\x65 QField, le 12 Novembre 2019 \xe0 Berne, inscription ouverte"
NewsFeed\httpsfeedqgisorg\20\imageUrl=https://feed.qgis.org/media/feedimages/2019/11/04/qfield_love_10_banner_d2qhDpq.jpg
NewsFeed\httpsfeedqgisorg\20\content="<div style=\"box-sizing: border-box; color: #4f4f4f; font-family: Roboto, sans-serif; font-size: 14px;\">\r\n<p class=\"v1MsoNormal\" style=\"box-sizing: border-box; margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: 'Times New Roman', serif;\">QField est une application mobile et personnalisable de saisie de donn&eacute;es spatiales. Il s'int&egrave;gre parfaitement avec QGIS, la solution SIG open-source la plus r&eacute;pandue.</p>\r\n</div>\r\n<div style=\"box-sizing: border-box; color: #4f4f4f; font-family: Roboto, sans-serif; font-size: 14px;\">\r\n<p class=\"v1MsoNormal\" style=\"box-sizing: border-box; margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: 'Times New Roman', serif;\">&nbsp;</p>\r\n<p class=\"v1MsoNormal\" style=\"box-sizing: border-box; margin: 0cm 0cm 0.0001pt; font-size: 12pt; font-family: 'Times New Roman', serif;\">Lors de cette journ&eacute;e, vous aurez l'occasion d'observer divers cas d'utilisation de QField. Nous passerons de la gestion des municipalit&eacute;s &agrave; la foresterie et &agrave; l'ing&eacute;nierie, en passant par la surveillance de la biodiversit&eacute;.</p>\r\n</div>"
