NewsFeed\httpsfeedqgisorg\21\title=Journ\xe9\x65s QGIS utilisateurs France - Montpellier  - 12 et 13 d\xe9\x63\x65mbre 2019
NewsFeed\httpsfeedqgisorg\21\imageUrl=https://feed.qgis.org/media/feedimages/2019/11/19/osgeo_qgis_2018_flamingo_only_small.jpg
NewsFeed\httpsfeedqgisorg\21\content="<p>Pour la septi&egrave;me ann&eacute;e cons&eacute;cutive le s&eacute;minaire utilisateurs QGIS se d&eacute;roulera &agrave; Montpellier. Cet &eacute;v&eacute;nement est organis&eacute; en partenariat entre <a href=\"https://www.montpellier-supagro.fr/\">Montpellier SupAgro</a> et l&rsquo;<a href=\"https://www.osgeo.asso.fr/\">OSGeo-fr</a>.</p>\r\n<p>&nbsp;L&rsquo;&eacute;v&eacute;nement se d&eacute;roulera sur 2 jours :</p>\r\n<ul>\r\n<li>\r\n<p><strong>Jeudi 12 d&eacute;cembre 2019</strong> Journ&eacute;e de barcamp o&ugrave; l&rsquo;objectif est que les utilisateurs &eacute;changent et travaillent en petits groupes sur des probl&eacute;matiques concr&egrave;tes.</p>\r\n</li>\r\n<li>\r\n<p><strong>Vendredi 13 d&eacute;cembre 2019</strong> Journ&eacute;e de conf&eacute;rence sur le m&ecirc;me format que les &eacute;ditions pr&eacute;c&eacute;dentes. Le programme est d&eacute;j&agrave; disponible !</p>\r\n</li>\r\n</ul>"
