NewsFeed\httpsfeedqgisorg\25\content="<p><span style=\"color: #222222; font-family: Arial, Helvetica, sans-serif; font-size: small;\">To better understand the needs of our QGIS community,&nbsp;</span><span style=\"color: #222222; font-family: Arial, Helvetica, sans-serif; font-size: small;\">we want to find out more about how different user groups and organisations use QGIS and particularly the LTR (Long Term Release) versions.</span><span style=\"color: #222222; font-family: Arial, Helvetica, sans-serif; font-size: small;\">&nbsp;</span></p>\r\n<p><span style=\"color: #222222; font-family: Arial, Helvetica, sans-serif; font-size: small;\">We therefore invite you to participate in our new LTR usage survey - <strong>double click</strong> this message to get started!</span></p>"
