NewsFeed\httpsfeedqgisorg\28\title=QGIS Plugins Repository Maintenance
NewsFeed\httpsfeedqgisorg\28\imageUrl=
NewsFeed\httpsfeedqgisorg\28\content="<p>Dear QGIS users. We will be carrying out <strong>scheduled maintenance</strong> on https://plugins.qgis.org on Friday 10 July starting at around 9 am GMT. We expect the maintenance to be completed within an hour or two. During this time the plugin repository (as accessed from the plugins menu in QGIS) and aforementioned web site may be <strong>offline</strong>, <strong>slow to respond</strong>, or <strong>sporadically unavailable</strong>. Thank you for your patience while we carry out this work.</p>"
