NewsFeed\httpsfeedqgisorg\33\title=Journ\xe9\x65s QGIS utilisateur France 15 et 16 d\xe9\x63\x65mbre 2019
NewsFeed\httpsfeedqgisorg\33\imageUrl=https://feed.qgis.org/media/feedimages/2020/11/18/logo_journees_crop.jpg
NewsFeed\httpsfeedqgisorg\33\content="<p>Apr&egrave;s 7 ans &agrave; Montpellier, le s&eacute;minaire utilisateurs QGIS se d&eacute;roulera en<strong> visio distante</strong>, sous des airs auvergnats. Cet &eacute;v&eacute;nement est organis&eacute; en partenariat entre le <a href=\"https://www.craig.fr/\">CRAIG</a> (<strong>C</strong>entre <strong>R</strong>&eacute;gional <strong>A</strong>uvergne-Rh&ocirc;ne-Alpes de l&rsquo;<strong>I</strong>nformation <strong>G</strong>&eacute;ographique) et l&rsquo;<a href=\"https://www.osgeo.asso.fr/\">OSGeo-fr</a>.</p>\r\n<p>L&rsquo;&eacute;v&eacute;nement se d&eacute;roulera sur 2 jours :</p>\r\n<ul>\r\n<li>\r\n<p><strong>Mardi 15 d&eacute;cembre 2020</strong> Journ&eacute;e d&rsquo;ateliers th&eacute;matiques et techniques.</p>\r\n</li>\r\n<li>\r\n<p><strong>Mercredi 16 d&eacute;cembre 2020</strong> Journ&eacute;e de conf&eacute;rences distancielles.</p>\r\n</li>\r\n</ul>\r\n<p>Les appels &agrave; proposition de pr&eacute;sentation sont ouverts !</p>\r\n<p>Toutes les informations sur http://conf.qgis.osgeo.fr/</p>\r\n<p>Suivez les actualit&eacute;s sur <a href=\"https://twitter.com/JourneesQgis\">http://conf.qgis.osgeo.fr/ et twitter<br /></a></p>"
NewsFeed\httpsfeedqgisorg\33\link=@Variant(\0\0\0\x11\0\0\0\x1ahttp://conf.qgis.osgeo.fr/)
NewsFeed\httpsfeedqgisorg\33\sticky=false
