NewsFeed\httpsfeedqgisorg\35\title=Scheduled Maintenance for Plugin Repository
NewsFeed\httpsfeedqgisorg\35\imageUrl=https://feed.qgis.org/media/feedimages/2021/01/26/qgis-plugin-repo.jpg
NewsFeed\httpsfeedqgisorg\35\content="<p>We are running out of space on our server running https://plugins.qgis.org - a sign of success, given the large number of plugins and plugin versions hosted on the platform. On <strong>Thursday 28 January at 9am West European Time</strong>, we will bring the server offline for a scheduled upgrade to the storage space on the server. We anticipate that the work will be completed within an hour. We thank you for your patience whilst we undertake this critical maintenance.&nbsp; The maintenance of QGIS infrastructure is undertaken largely by volunteers and the cost of servers and hosting related costs are funded by your donations and sustaining memberships. If you would like to help support this (and the many other excellent initiatives carried out by QGIS.org), please consider <strong>double clicking this news item</strong> to find out how you can help!</p>"
NewsFeed\httpsfeedqgisorg\35\link=@Variant(\0\0\0\x11\0\0\0\x83https://qgis.org/en/site/getinvolved/governance/sustaining_members/sustaining_members.html#how-can-you-support-the-qgis-development)
