NewsFeed\httpsfeedqgisorg\36\title=QGIS Open Day 26 Feb 2021
NewsFeed\httpsfeedqgisorg\36\imageUrl=https://feed.qgis.org/media/feedimages/2021/02/19/QGIS_Plugged_in.jpg
NewsFeed\httpsfeedqgisorg\36\content="<p>On Friday, 26 February 2021 we will be holding our monthly QGIS Open Day! What is a QGIS Open Day you may be wondering to yourself? It is an initiative to replace the wonderful community meetups we used to hold every six months when times were different. Like our in-person meetings, the event is organised on a principle of self-organisation and community participation. This open day will have the theme of &ldquo;QGIS Plugged In!&rdquo; and will be hosted, organised, focussed on and presented by young GIS practitioners from around the world! To find out more, please <strong>double-click</strong> this article to open the event page in your browser.</p>"
NewsFeed\httpsfeedqgisorg\36\link=@Variant(\0\0\0\x11\0\0\0\x33https://github.com/qgis/QGIS/wiki/QHF-February-2021)
NewsFeed\httpsfeedqgisorg\36\sticky=false
NewsFeed\httpsfeedqgisorg\37\title=QGIS Open Day 26 March 2021
NewsFeed\httpsfeedqgisorg\37\imageUrl=https://feed.qgis.org/media/feedimages/2021/03/25/QGIS_intergrated_2.jpg
NewsFeed\httpsfeedqgisorg\37\content="<p>On Friday, 26 March 2021 we will be holding our monthly QGIS Open Day! What is a QGIS Open Day you may be wondering to yourself? It is an initiative to replace the wonderful community meetups we used to hold every six months when times were different. Like our in-person meetings, the event is organised on a principle of self-organisation and community participation. This open day will have the theme of &ldquo;QGIS INTEGRATED\". We will have sessions that that show QGIS working as part of platforms, integrated with other software and programs to create dynamic and shareable spatial data, maps, and systems. To find out more, please <strong>double-click</strong> this article to open the event page in your browser.</p>"
