NewsFeed\httpsfeedqgisorg\38\title=Vote du groupe QGIS-FR pour les subventions QGIS.org
NewsFeed\httpsfeedqgisorg\38\imageUrl=
NewsFeed\httpsfeedqgisorg\38\content="<p>Chaque ann&eacute;e, QGIS.org alloue des fonds pour subventionner des initiatives d'&eacute;volution du projet et c'est &agrave; la communaut&eacute; de d&eacute;cider des propositions &agrave; retenir par un vote.</p>\r\n<p>Le groupe QGIS-FR dispose d'un droit de vote .</p>\r\n<p>Venez nous aider au choix, en participant au sondage sur <a href=\"https://urldefense.com/v3/__https:/sondage.osgeo.asso.fr/index.php/452829__;!!GXVuaUlRqA!OeaoPpzBqIniEQ1CKpd6x3_K1I1GY1fB3TAQkmUKvS4L44I74aRRGbp_m-8-Ame4xe2u$\"> https://sondage.osgeo.asso.fr/index.php/452829</a> !</p>\r\n<div>L'annonce de lancement : <a href=\"https://blog.qgis.org/2021/02/21/qgis-grants-6-call-for-grant-proposals-2021/\" target=\"_blank\">https://blog.qgis.org/2021/02/21/qgis-grants-6-call-for-grant-proposals-2021/</a></div>\r\n<div>&nbsp;</div>\r\n<div>Le groupe QGIS-FR</div>"
